        public static int PTotal { get; set; }


        /// <summary>
        /// Pre-loads all DB data.
        /// </summary>
		public static async void LoadDBData() 
		{
            //testes
            await LoadPromotions(true);

			await LoadData ();
            await LoadBiometricData();
            
		}

        /// <summary>
        /// Pre-loads all the biometric data from the database
        /// </summary>
        /// <returns></returns>
        public static async Task LoadBiometricData()
        {
            // Load Biometric User
            await App.UsersViewModel.LoadDataAsync();

            if (SessionData.BiometricUser == null) return;
            
            // Load IMC
            await App.BiometricIMCVM.LoadData();

            // Arterial Pressure
            await App.BiometricArterialPressureVM.LoadData();

            // Abdominal Perimeter
            await App.BiometricAbdominalPerimeterVM.LoadData();

            // Cholesterol
            await App.BiometricCholesterolVM.LoadData();

            // Glicemia
            await App.BiometricGlicemiaVM.LoadData();

            // Triglycerides
            await App.BiometricTriglyceridesVM.LoadData();

            // Height
            await App.BiometricHeightVM.LoadData();

            // Weight
            await App.BiometricWeightVM.LoadData();
        }

		//testes
		public static async Task LoadPromotions(bool fromHome2)
		{
			if (fromHome2)
			{
				await App.PromotionsVM.LoadList(true);
			}
			else 
			{
				await App.PromotionsVM.LoadList(false);
			}
		

            


            PTotal = App.PromotionsVM.PromoTotal;

        }

        #region Load Pharmacies

        static async Task LoadData() {

			ShiftTypeDAO db = new ShiftTypeDAO ();
			List<ShiftType> shifts = await db.GetAll ();

			if (shifts.Count == 0)
			{
				await LoadShifts();
				await LoadShedules();
			}

			if (!SessionData.DistrictsDBVersion.HasValue || SessionData.DistrictsDBVersion < ANFAPP.Logic.Settings.CURRENT_DISTRICTS_DB_VERSION)
			{
				// Locations need to be updated
				var locationsDB = new LocalizationDAO();
				await locationsDB.DeleteAll();
				await LoadLocalizations();

				// Save version
				SessionData.DistrictsDBVersion = ANFAPP.Logic.Settings.CURRENT_DISTRICTS_DB_VERSION;
			}

		}

		async static Task LoadShedules() {

			List<ScheduleType> schedules = new List<ScheduleType> {
				new ScheduleType () { Code = "0", Description = "Domingo" },
				new ScheduleType () { Code = "1", Description = "Segunda" },
				new ScheduleType () { Code = "2", Description = "Terça" },
				new ScheduleType () { Code = "3", Description = "Quarta" },
				new ScheduleType () { Code = "4", Description = "Quinta" },
				new ScheduleType () { Code = "5", Description = "Sexta" },
				new ScheduleType () { Code = "6", Description = "Sábado" },
				new ScheduleType () { Code = "7", Description = "Dias Úteis" },
				new ScheduleType () { Code = "8", Description = "Fim de Semana" },
			};

			ScheduleTypeDAO db = new ScheduleTypeDAO ();
			await db.InsertAll (schedules);
		}

        async static Task LoadShifts()
        {
			List<ShiftType> shifts = new List<ShiftType> {
				new ShiftType() { Code = "0", Description = "Serviço permanente"},
				new ShiftType() { Code = "1", Description = "Regime de reforço"},
				new ShiftType() { Code = "2", Description = "Regime de disponibilidade"},
				new ShiftType() { Code = "3", Description = "24 Horas"},
				new ShiftType() { Code = "4", Description = "Serviço permanente até às 22 horas"}
			};

			ShiftTypeDAO db = new ShiftTypeDAO ();
			await db.InsertAll (shifts);
		}

